func NewBitbank(userConfig map[string]interface{}) *Bitbank {
	p := NewBitbankCore()
	p.Init(userConfig)
	return &Bitbank{
		BitbankCore:   p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewBitbankFromCore(core *BitbankCore) *Bitbank {
	return &Bitbank{
		BitbankCore:   core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

